import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Solutions", "Projects", "Gear", "Music", "Contact"];
export default function Header() {
  return (

    <nav class="navbar fixed-top navbar-expand-lg toggle-height" id="global-nav">
    <link rel="stylesheet" type="text/css" href="/static/nav.css"/>
      <div class="container">
        <Link href="/">
          <a class="navbar-brand scrollN">Prabhakar Mishra</a>
        </Link>
        {services_array.map(service => (
          <Link href={`/${service}`}>
            <button style={linkStyle}>
              <span>{service}</span>
            </button>
          </Link>
        ))}
      </div>
    </nav>

  )
}
